import React, { Component } from "react";

class Form extends Component {
  render() {
    const { handleSubmit, setName, name, links, setLink } = this.props;
    return (
      <form onSubmit={(e) => {
        e.preventDefault();
        handleSubmit();
      }}>
        <div>
          <div>
          <div > Name </div>
            <input
              value={name}
              onChange={(event) => setName(event.target.value)}
              type="name"
              name="task"

            />
          </div>
          <div>
            <div> URL </div>
            <input
              value={links}
              onChange={(event) => setLink(event.target.value)}
              type="link"
              name="link"

            />
          </div>
          <button
              type="submit"

            >
              Submit
            </button>

        </div>
      </form>
    );
  }
}

export default Form
